import './App.css';
import ComponentsList from "./Components/ComponentsLists";
import HomeScreen from './Components/ChildComponents/HomeScreen';
import { BrowserRouter,Routes,Route } from "react-router-dom";
import { useNavigate } from "react-router";

import { Link } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* Logo links to "/" (HomeScreen) */}
        <button></button>
        <Link to="/" className="home-button">
          <img src={image} className="App-logo" alt="Home" />
        </Link>
        {/* ComponentsList contains your routes (leave it untouched) */}
        <ComponentsList />
      </header>
    </div>
  );
}

export default App;
